import {Card, CardContent, Typography} from "@material-ui/core";

const ReminderCard = ({reminder}) => {

    return(
        <Card style={{backgroundColor: "#189AB4"}}>
            <CardContent>
                <Typography style={{color: "white"}} variant="h5">{reminder.title}</Typography>
                <Typography style={{color: "white"}}>Due : {reminder.due}</Typography>
                <Typography style={{color: "white"}}>Completed: {reminder.completed ? "Yes": "No"}</Typography>
            </CardContent>
        </Card>
    )
}

export default ReminderCard;
